export const getBestRatedFilm = (films) =>{
    let bestRatedFilm = {rating : 0}
    films.forEach((film) =>{
        if(films?.rating > bestRatedFilm?.rating)
        bestRatedFilm = {...film}
    })
    return bestRatedFilm?.name
}
